import React from "react";

function Contact() {
    var hovered = document.querySelectorAll("hover");
    var hover = false;

    return (
        <div className="contact">
            <h1>
                Contact
            </h1>
            <ul hidden={hover} id="ul_type">
                <li id="ul_type">
                    Mail
                </li>
                <li id="ul_type">
                    LinkedIn
                </li>
                <li>
                    Call
                </li>
            </ul>
        </div>
    );
}

export default Contact;
